import React, {Component} from 'react';
import Header from './Header';
import Counter from './Counter';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      ctr: 2
    }
  }
  render() {
    return (
      <div>
      <Header />
      <Counter />
      </div>
    )
  }
}

export default App;
